class Solution {
public:
    vector<string> divideString(string s, int k, char fill) {
        vector<string> ans;
        string tmp = "";
        for (int i = 0; i < s.length(); i++) {
            if (i > 0 && i % k == 0) {
                ans.push_back(tmp);
                tmp = "";
            }
            tmp += s[i];
        }
        if (tmp.length() == 0) {
            return ans;
        }
        while (tmp.length() < k) {
            tmp += fill;
        }
        ans.push_back(tmp);
        return ans;
    }
};

