class Solution {
public:
    int minMoves(int target, int maxDoubles) {
        int count = 0;
        while (maxDoubles > 0 && target > 1) {
            maxDoubles--;
            count += target % 2;
            target /= 2;
            count++;
        }
        return count + target - 1;
    }
};

