class Solution {
public:
    long long mostPoints(vector<vector<int>>& questions) {
        vector<vector<int>>& q = questions;
        int n = q.size();
        vector<long long> dp(n);
        vector<long long> mx(n);
        mx[n-1] = dp[n-1] = q[n-1][0];
        for (int i = n-2; i >= 0; i--) {
            int next = i + q[i][1] + 1;
            dp[i] = max((long long)q[i][0] + (next < n? mx[next]: 0), dp[i+1]);
            mx[i] = max(dp[i], mx[i+1]);
        }
        for (int i = 0; i < n; i++) {
            printf("%lld ", dp[i]);
        }
        return dp[0];
    }
};

