class Solution {
public:
    long long maxRunTime(int n, vector<int>& batteries) {
        vector<int>& b = batteries;
        sort(b.begin(), b.end(), greater<int>());
        long long sum = 0;
        for (int i = n; i < b.size(); i++) {
            sum += b[i];
        }
        int low = b[n-1];
        int high;
        int ptr = n-1;
        while (ptr != -1) {
            while (ptr != -1 && b[ptr] == low) {
                ptr--;
            }
            if (ptr == -1) {
                return low + sum / n;
            }
            high = b[ptr];
            int count = n - ptr - 1;
            long long fill = count*(high-low);
            if (sum < fill) {
                return low + sum / count;
            }
            sum -= fill;
            low = high;
        }
        return -1;
    }
};
